html="""
<!DOCTYPE html>
<html lang="zh">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
    <style>
        . {
            margin: 0;
            padding: 0;
        }
        button {
            background-color: #000000;
            border: none;
            border-radius: 5px;
            color: #ffffff;
            padding: 10px 20px;
        }
        .container {
            display: flex;
            align-items: center;
            margin-top: 10px;
        }
        p {
            margin: 0;
        }
    </style>
</head>
<body>
<div style="display:flex;flex-direction:column;align-items: center;">
    <div class="container">
        <img alt="disable"
             src="data:image/png;base64,"/>
        <img alt="enable"
             src="data:image/png;base64,"/>
    </div>
    <div class="container"> 当前状态：<p id="msg"></p></div>
    <div class="container">
        <p>启用方案：</p>
        <input style="margin: 0;" type="radio" id="planChoice1" name="plan" value="plan1" checked/> <label
            for="planChoice1" style="margin: 0 10px;">方案1</label>
        <input style="margin: 0;" type="radio" id="planChoice2" name="plan" value="plan2"/>
        <label for="planChoice2"
               style="margin: 0 10px;">方案2</label>
    </div>
    <div style="border: 1px dotted black;padding: 2px;margin-top: 5px;font-size: 12px ">
        <p>所有的操作都需要重启电脑才能生效，如果禁用后使用方案1无法启用键盘，请尝试方案2。</p>
        <p>软件通过 i8042 键盘和PS/2鼠标端口驱动程序实现禁用键盘功能，但是可能会意外禁用其他设备的连接，请自行评估风险，软件开发者不为此承担任何责任。</p>
    </div>
    <div class="container">
        <button id="btn2" class="button" style="margin-right: 10px">重启电脑</button>
        <button id="btn1" class="button" style="margin-left: 10px">禁用/启用</button>
    </div>
</div>
<script>
    let tag_enable = eval("service_status");
    let btn1 = document.getElementById('btn1');
    let btn2 = document.getElementById('btn2');
    let msg = document.getElementById('msg');
    let changeTag = false;

    function updateUI() {
        msg.innerText = `${tag_enable ? '已启用' : '已禁用'}`
        if (changeTag) {
            msg.innerText = msg.innerText + '(已修改,重启电脑生效)'
        }

        if (tag_enable) {
            // 修改图片的 src 属性
            document.querySelector('img[alt="disable"]').style.display = 'none';
            document.querySelector('img[alt="enable"]').style.display = 'block';
        } else {
            // 修改图片的 src 属性
            document.querySelector('img[alt="disable"]').style.display = 'block';
            document.querySelector('img[alt="enable"]').style.display = 'none';
        }
    }
    updateUI()
    btn1.addEventListener('click', function () {
        changeTag = true;
        tag_enable = !tag_enable
        updateUI()
        const plan = document.querySelector('input[name="plan"]:checked').value
        const state = tag_enable ? 'enable' : 'disable'
        pywebview.api.alter_state( state,plan)
    });
    btn2.addEventListener('click', function () {
        pywebview.api.re_start_compute(1)
    });
</script>
</body>
"""